import { Component, Output, EventEmitter } from '@angular/core';

@Component({
  selector: 'app-mr-iq',
  template: `
    <div>
      <button (click)="onAgree()" [disabled]="hasVoted">Agree</button>
      <button (click)="onDisagree()" [disabled]="hasVoted">Disagree</button>
    </div>
  `
})
export class MrIqComponent {
  hasVoted = false;
  @Output() agree = new EventEmitter<void>();
  @Output() disagree = new EventEmitter<void>();

  onAgree() {
    this.hasVoted = true;
    this.agree.emit();
  }

  onDisagree() {
    this.hasVoted = true;
    this.disagree.emit();
  }
}
